import React from "react";
import Card from "react-bootstrap/Card";

function Bookcard(props) {
  return (
    <Card style={{ width: '18rem' }}>
    <Card.Img variant="top" src={props.image} />
    <Card.Body>
      <Card.Title>{props.title}</Card.Title>
      <Card.Text>{}
      </Card.Text>
    </Card.Body>
  </Card>
  );
}

export default Bookcard;
